mapper.select:

select 

from RMPEND
where RMPEND_DATE = #{rmpendDate,jdbcType=CHAR}
  and RMPEND_BRNO = #{rmpendBrno,jdbcType=CHAR}
  and RMPEND_FEPNO = #{rmpendFepno,jdbcType=CHAR}

mapper.delete:

delete from RMPEND
where RMPEND_DATE = #{rmpendDate,jdbcType=CHAR}
  and RMPEND_BRNO = #{rmpendBrno,jdbcType=CHAR}
  and RMPEND_FEPNO = #{rmpendFepno,jdbcType=CHAR}
